A designation of a specific field behavior (required, output only, etc.)
in protobuf messages.

Examples:

  string name = 1 [(google.api.field_behavior) = REQUIRED];
  State state = 1 [(google.api.field_behavior) = OUTPUT_ONLY];
  google.protobuf.Duration ttl = 1
    [(google.api.field_behavior) = INPUT_ONLY];
  google.protobuf.Timestamp expire_time = 1
    [(google.api.field_behavior) = OUTPUT_ONLY,
     (google.api.field_behavior) = IMMUTABLE];

Rich semantic descriptor of an API field beyond the basic typing.

Examples:

    string request_id = 1 [(google.api.field_info).format = UUID4];
    string old_ip_address = 2 [(google.api.field_info).format = IPV4];
    string new_ip_address = 3 [(google.api.field_info).format = IPV6];
    string actual_ip_address = 4 [
      (google.api.field_info).format = IPV4_OR_IPV6
    ];
    google.protobuf.Any generic_field = 5 [
      (google.api.field_info).referenced_types = {type_name: "ActualType"},
      (google.api.field_info).referenced_types = {type_name: "OtherType"},
    ];
    google.protobuf.Any generic_user_input = 5 [
      (google.api.field_info).referenced_types = {type_name: "*"},
    ];

Message that represents an arbitrary HTTP body. It should only be used for
payload formats that can't be represented as JSON, such as raw binary or
an HTML page.

This message can be used both in streaming and non-streaming API methods in
the request as well as the response.

It can be used as a top-level request field, which is convenient if one
wants to extract parameters from either the URL or HTTP template into the
request fields and also want access to the raw HTTP body.

Example:

    message GetResourceRequest {
      // A unique request id.
      string request_id = 1;

      // The raw HTTP body is bound to this field.
      google.api.HttpBody http_body = 2;

    }

    service ResourceService {
      rpc GetResource(GetResourceRequest)
        returns (google.api.HttpBody);
      rpc UpdateResource(google.api.HttpBody)
        returns (google.protobuf.Empty);

    }

Example with streaming methods:

    service CaldavService {
      rpc GetCalendar(stream google.api.HttpBody)
        returns (stream google.api.HttpBody);
      rpc UpdateCalendar(stream google.api.HttpBody)
        returns (stream google.api.HttpBody);

    }

Use of this type only changes how the request and response bodies are
handled, all other features will continue to work unchanged.

A simple descriptor of a resource type.

ResourceDescriptor annotates a resource message (either by means of a
protobuf annotation or use in the service config), and associates the
resource's schema, the resource type, and the pattern of the resource name.

Example:

    message Topic {
      // Indicates this message defines a resource schema.
      // Declares the resource type in the format of {service}/{kind}.
      // For Kubernetes resources, the format is {api group}/{kind}.
      option (google.api.resource) = {
        type: "pubsub.googleapis.com/Topic"
        pattern: "projects/{project}/topics/{topic}"
      };
    }

The ResourceDescriptor Yaml config will look like:

    resources:
    - type: "pubsub.googleapis.com/Topic"
      pattern: "projects/{project}/topics/{topic}"

Sometimes, resources have multiple patterns, typically because they can
live under multiple parents.

Example:

    message LogEntry {
      option (google.api.resource) = {
        type: "logging.googleapis.com/LogEntry"
        pattern: "projects/{project}/logs/{log}"
        pattern: "folders/{folder}/logs/{log}"
        pattern: "organizations/{organization}/logs/{log}"
        pattern: "billingAccounts/{billing_account}/logs/{log}"
      };
    }

The ResourceDescriptor Yaml config will look like:

    resources:
    - type: 'logging.googleapis.com/LogEntry'
      pattern: "projects/{project}/logs/{log}"
      pattern: "folders/{folder}/logs/{log}"
      pattern: "organizations/{organization}/logs/{log}"
      pattern: "billingAccounts/{billing_account}/logs/{log}"

Optional. The historical or future-looking state of the resource pattern.

Example:

    // The InspectTemplate message originally only supported resource
    // names with organization, and project was added later.
    message InspectTemplate {
      option (google.api.resource) = {
        type: "dlp.googleapis.com/InspectTemplate"
        pattern:
        "organizations/{organization}/inspectTemplates/{inspect_template}"
        pattern: "projects/{project}/inspectTemplates/{inspect_template}"
        history: ORIGINALLY_SINGLE_PATTERN
      };
    }

The resource type that the annotated field references.

Example:

    message Subscription {
      string topic = 2 [(google.api.resource_reference) = {
        type: "pubsub.googleapis.com/Topic"
      }];
    }

Occasionally, a field may reference an arbitrary resource. In this case,
APIs use the special value * in their resource reference.

Example:

    message GetIamPolicyRequest {
      string resource = 2 [(google.api.resource_reference) = {
        type: "*"
      }];
    }

The resource type of a child collection that the annotated field
references. This is useful for annotating the `parent` field that
doesn't have a fixed resource type.

Example:

    message ListLogEntriesRequest {
      string parent = 1 [(google.api.resource_reference) = {
        child_type: "logging.googleapis.com/LogEntry"
      };
    }

Specifies the routing information that should be sent along with the request
in the form of routing header.
**NOTE:** All service configuration rules follow the "last one wins" order.

The examples below will apply to an RPC which has the following request type:

Message Definition:

    message Request {
      // The name of the Table
      // Values can be of the following formats:
      // - `projects/<project>/tables/<table>`
      // - `projects/<project>/instances/<instance>/tables/<table>`
      // - `region/<region>/zones/<zone>/tables/<table>`
      string table_name = 1;

      // This value specifies routing for replication.
      // It can be in the following formats:
      // - `profiles/<profile_id>`
      // - a legacy `profile_id` that can be any string
      string app_profile_id = 2;
    }

Example message:

    {
      table_name: projects/proj_foo/instances/instance_bar/table/table_baz,
      app_profile_id: profiles/prof_qux
    }

The routing header consists of one or multiple key-value pairs. Every key
and value must be percent-encoded, and joined together in the format of
`key1=value1&key2=value2`.
In the examples below I am skipping the percent-encoding for readablity.

Example 1

Extracting a field from the request to put into the routing header
unchanged, with the key equal to the field name.

annotation:

    option (google.api.routing) = {
      // Take the `app_profile_id`.
      routing_parameters {
        field: "app_profile_id"
      }
    };

result:

    x-goog-request-params: app_profile_id=profiles/prof_qux

Example 2

Extracting a field from the request to put into the routing header
unchanged, with the key different from the field name.

annotation:

    option (google.api.routing) = {
      // Take the `app_profile_id`, but name it `routing_id` in the header.
      routing_parameters {
        field: "app_profile_id"
        path_template: "{routing_id=**}"
      }
    };

result:

    x-goog-request-params: routing_id=profiles/prof_qux

Example 3

Extracting a field from the request to put into the routing
header, while matching a path template syntax on the field's value.

NB: it is more useful to send nothing than to send garbage for the purpose
of dynamic routing, since garbage pollutes cache. Thus the matching.

Sub-example 3a

The field matches the template.

annotation:

    option (google.api.routing) = {
      // Take the `table_name`, if it's well-formed (with project-based
      // syntax).
      routing_parameters {
        field: "table_name"
        path_template: "{table_name=projects/*/instances/*/**}"
      }
    };

result:

    x-goog-request-params:
    table_name=projects/proj_foo/instances/instance_bar/table/table_baz

Sub-example 3b

The field does not match the template.

annotation:

    option (google.api.routing) = {
      // Take the `table_name`, if it's well-formed (with region-based
      // syntax).
      routing_parameters {
        field: "table_name"
        path_template: "{table_name=regions/*/zones/*/**}"
      }
    };

result:

    <no routing header will be sent>

Sub-example 3c

Multiple alternative conflictingly named path templates are
specified. The one that matches is used to construct the header.

annotation:

    option (google.api.routing) = {
      // Take the `table_name`, if it's well-formed, whether
      // using the region- or projects-based syntax.

      routing_parameters {
        field: "table_name"
        path_template: "{table_name=regions/*/zones/*/**}"
      }
      routing_parameters {
        field: "table_name"
        path_template: "{table_name=projects/*/instances/*/**}"
      }
    };

result:

    x-goog-request-params:
    table_name=projects/proj_foo/instances/instance_bar/table/table_baz

Example 4

Extracting a single routing header key-value pair by matching a
template syntax on (a part of) a single request field.

annotation:

    option (google.api.routing) = {
      // Take just the project id from the `table_name` field.
      routing_parameters {
        field: "table_name"
        path_template: "{routing_id=projects/*}/**"
      }
    };

result:

    x-goog-request-params: routing_id=projects/proj_foo

Example 5

Extracting a single routing header key-value pair by matching
several conflictingly named path templates on (parts of) a single request
field. The last template to match "wins" the conflict.

annotation:

    option (google.api.routing) = {
      // If the `table_name` does not have instances information,
      // take just the project id for routing.
      // Otherwise take project + instance.

      routing_parameters {
        field: "table_name"
        path_template: "{routing_id=projects/*}/**"
      }
      routing_parameters {
        field: "table_name"
        path_template: "{routing_id=projects/*/instances/*}/**"
      }
    };

result:

    x-goog-request-params:
    routing_id=projects/proj_foo/instances/instance_bar

Example 6

Extracting multiple routing header key-value pairs by matching
several non-conflicting path templates on (parts of) a single request field.

Sub-example 6a

Make the templates strict, so that if the `table_name` does not
have an instance information, nothing is sent.

annotation:

    option (google.api.routing) = {
      // The routing code needs two keys instead of one composite
      // but works only for the tables with the "project-instance" name
      // syntax.

      routing_parameters {
        field: "table_name"
        path_template: "{project_id=projects/*}/instances/*/**"
      }
      routing_parameters {
        field: "table_name"
        path_template: "projects/*/{instance_id=instances/*}/**"
      }
    };

result:

    x-goog-request-params:
    project_id=projects/proj_foo&instance_id=instances/instance_bar

Sub-example 6b

Make the templates loose, so that if the `table_name` does not
have an instance information, just the project id part is sent.

annotation:

    option (google.api.routing) = {
      // The routing code wants two keys instead of one composite
      // but will work with just the `project_id` for tables without
      // an instance in the `table_name`.

      routing_parameters {
        field: "table_name"
        path_template: "{project_id=projects/*}/**"
      }
      routing_parameters {
        field: "table_name"
        path_template: "projects/*/{instance_id=instances/*}/**"
      }
    };

result (is the same as 6a for our example message because it has the instance
information):

    x-goog-request-params:
    project_id=projects/proj_foo&instance_id=instances/instance_bar

Example 7

Extracting multiple routing header key-value pairs by matching
several path templates on multiple request fields.

NB: note that here there is no way to specify sending nothing if one of the
fields does not match its template. E.g. if the `table_name` is in the wrong
format, the `project_id` will not be sent, but the `routing_id` will be.
The backend routing code has to be aware of that and be prepared to not
receive a full complement of keys if it expects multiple.

annotation:

    option (google.api.routing) = {
      // The routing needs both `project_id` and `routing_id`
      // (from the `app_profile_id` field) for routing.

      routing_parameters {
        field: "table_name"
        path_template: "{project_id=projects/*}/**"
      }
      routing_parameters {
        field: "app_profile_id"
        path_template: "{routing_id=**}"
      }
    };

result:

    x-goog-request-params:
    project_id=projects/proj_foo&routing_id=profiles/prof_qux

Example 8

Extracting a single routing header key-value pair by matching
several conflictingly named path templates on several request fields. The
last template to match "wins" the conflict.

annotation:

    option (google.api.routing) = {
      // The `routing_id` can be a project id or a region id depending on
      // the table name format, but only if the `app_profile_id` is not set.
      // If `app_profile_id` is set it should be used instead.

      routing_parameters {
        field: "table_name"
        path_template: "{routing_id=projects/*}/**"
      }
      routing_parameters {
         field: "table_name"
         path_template: "{routing_id=regions/*}/**"
      }
      routing_parameters {
        field: "app_profile_id"
        path_template: "{routing_id=**}"
      }
    };

result:

    x-goog-request-params: routing_id=profiles/prof_qux

Example 9

Bringing it all together.

annotation:

    option (google.api.routing) = {
      // For routing both `table_location` and a `routing_id` are needed.
      //
      // table_location can be either an instance id or a region+zone id.
      //
      // For `routing_id`, take the value of `app_profile_id`
      // - If it's in the format `profiles/<profile_id>`, send
      // just the `<profile_id>` part.
      // - If it's any other literal, send it as is.
      // If the `app_profile_id` is empty, and the `table_name` starts with
      // the project_id, send that instead.

      routing_parameters {
        field: "table_name"
        path_template: "projects/*/{table_location=instances/*}/tables/*"
      }
      routing_parameters {
        field: "table_name"
        path_template: "{table_location=regions/*/zones/*}/tables/*"
      }
      routing_parameters {
        field: "table_name"
        path_template: "{routing_id=projects/*}/**"
      }
      routing_parameters {
        field: "app_profile_id"
        path_template: "{routing_id=**}"
      }
      routing_parameters {
        field: "app_profile_id"
        path_template: "profiles/{routing_id=*}"
      }
    };

result:

    x-goog-request-params:
    table_location=instances/instance_bar&routing_id=prof_qux

Structured claims presented with the credential. JWTs include `{key: value}` pairs for standard and private claims. The following is a subset of the standard required and optional claims that would typically be presented for a Google-based JWT:
{'iss': 'accounts.google.com', 'sub': '113289723416554971153', 'aud': ['123456789012', 'pubsub.googleapis.com'], 'azp': '123456789012.apps.googleusercontent.com', 'email': 'jsmith@example.com', 'iat': 1353601026, 'exp': 1353604926}
SAML assertions are similarly specified, but with an identity provider dependent structure.

Describes the cause of the error with structured details.

Example of an error when contacting the "pubsub.googleapis.com" API when it
is not enabled:

    { "reason": "API_DISABLED"
      "domain": "googleapis.com"
      "metadata": {
        "resource": "projects/123",
        "service": "pubsub.googleapis.com"
      }
    }

This response indicates that the pubsub.googleapis.com API is not enabled.

Example of an error that is returned when attempting to create a Spanner
instance in a region that is out of stock:

    { "reason": "STOCKOUT"
      "domain": "spanner.googleapis.com",
      "metadata": {
        "availableRegions": "us-central1,us-east2"
      }
    }

A path that leads to a field in the request body. The value will be a
sequence of dot-separated identifiers that identify a protocol buffer
field.

Consider the following:

    message CreateContactRequest {
      message EmailAddress {
        enum Type {
          TYPE_UNSPECIFIED = 0;
          HOME = 1;
          WORK = 2;
        }

        optional string email = 1;
        repeated EmailType type = 2;
      }

      string full_name = 1;
      repeated EmailAddress email_addresses = 2;
    }

In this example, in proto `field` could take one of the following values:

* `full_name` for a violation in the `full_name` value
* `email_addresses[1].email` for a violation in the `email` field of the
  first `email_addresses` message
* `email_addresses[3].type[2]` for a violation in the second `type`
  value in the third `email_addresses` message.

In JSON, the same values are represented as:

* `fullName` for a violation in the `fullName` value
* `emailAddresses[1].email` for a violation in the `email` field of the
  first `emailAddresses` message
* `emailAddresses[3].type[2]` for a violation in the second `type`
  value in the third `emailAddresses` message.

